            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "3kRl7gkXdXM",
              "textDisplay": "Last Part 7 of 7\u003cbr\u003e\u003cbr\u003eBTS is a true phenomenon of our generation. It‚Äôs really a story from ‚Äùnobodies‚Äù to legends. Each of the things they‚Äôve achieved and accomplished are well deserved and hard earned. They deserve their support, without those bitter, jealous, ignorant haters who‚Äôre downgrading their music, quality, talent, artistery and versatility. Haters will hate no matter what. The bigger success the more haters come alongbut most importantly more Armys.\u003cbr\u003e\u003cbr\u003eLynda Olanoff, creative consultant for horror films in Hollywood like Nightmare Before Christmas, working for Disney/Pixar, Warner bros etc. She tweeted: ‚ÄùThey are all very kind and humble, every last one of them. Had a chance to meet them at the Rose Bowl (LA) show back in May (2019). The love they have for eachother is amazing. I‚Äôve seen groups come and go for over 40 years now and let me tell you, BTS is here to stay.‚Äù \u003cbr\u003e\u003cbr\u003eTv-show host Jimmy Fallon said 2020: ‚ÄùIn my opinion there‚Äôs no other bigger band, in the United states and in the world. There‚Äôs no other bigger band than BTS. They can dance, they can sing, they can rap! They always put the time and the effort in. There‚Äôs no one like them. \u003cbr\u003eEverytime they came on, they would say something else to me, they‚Äôd say, we want to do this next, and they would do it! We wanna get nominated for a Grammy, and they did! It‚Äôs amazing. They‚Äôre magic. BTS is magic.‚Äù\u003cbr\u003e\u003cbr\u003eDue to the pandemic, BTS had to cancel their 2020 ‚ÄùMap Of the Soul‚Äù World Tour. In their annual ‚ÄùBTS Festa‚Äù party for their 7th anniversary, they heartfeltly teared up as they (at \u003ca href=\"https://www.youtube.com/watch?v=3kRl7gkXdXM&amp;t=47m50s\"\u003e47:50\u003c/a\u003e) talked about this: \u003ca href=\"https://youtu.be/t9zPnWQIiuw\"\u003ehttps://youtu.be/t9zPnWQIiuw\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eHowever they‚Äôve kept working non-stop. They‚Äôve released two albums, had tons of wonderful performances with remarkable production works and scenographies, done VLives, interviews etc.\u003cbr\u003eThey performed a free live-streamed concert ‚ÄúBang Bang Con The Live Concert‚Äù. On Weverse they released their latest docu-series: ‚ÄùBreak The Silence‚Äù.\u003cbr\u003eFor their performance at Youtube‚Äôs ‚ÄùDear Class of 2020‚Äù, BTS rented ‚ÄùThe National Museum of Korea‚Äù (whereas other artists sang in their houses): \u003ca href=\"https://youtu.be/ErTgtL1Tjns\"\u003ehttps://youtu.be/ErTgtL1Tjns\u003c/a\u003e\u003cbr\u003eThey released two Japanese singles  ‚ÄùStay Gold‚Äù and breathtakingly ballad ‚ÄùYour Eyes Tell‚Äù composed by JK, which once again proved BTS‚Äôs amazing vocalists. This was the first Japanese song in history to achieve 92 #1 in the first 24h. One of their live performances in Japan: \u003ca href=\"https://youtu.be/E1uFvKzoNwA\"\u003ehttps://youtu.be/E1uFvKzoNwA\u003c/a\u003e \u003cbr\u003eWhen they had to cancel their World Tour, they wanted to reach out to Army around the world in a difficult time by making a new, brighter album. During the planning of the album, BTS told us that it‚Äôd be more ‚Äùuplifting‚Äù than the previous album. Their solid debute performance of comeback single ‚ÄùDynamite‚Äù on ‚ÄùMTV VMAs‚Äù, and also won 4 awards: \u003ca href=\"https://youtu.be/zJCdkOpU90g\"\u003ehttps://youtu.be/zJCdkOpU90g\u003c/a\u003e\u003cbr\u003eBTS performed amazingly  for ‚ÄùAmerica‚Äôs Got Talent‚Äù: \u003ca href=\"https://youtu.be/MH_vjfNPv70\"\u003ehttps://youtu.be/MH_vjfNPv70\u003c/a\u003e\u003cbr\u003eThe dance practice video: \u003ca href=\"https://youtu.be/CN4fffh7gmk\"\u003ehttps://youtu.be/CN4fffh7gmk\u003c/a\u003e\u003cbr\u003eTheir great ‚ÄùTiny Desk Home Concert‚Äù: \u003ca href=\"https://youtu.be/gFYAXsa7pe8\"\u003ehttps://youtu.be/gFYAXsa7pe8\u003c/a\u003e  \u003cbr\u003eTheir performances at Lotte Duty Free Family concert: \u003ca href=\"https://youtu.be/T29a0mnFka0\"\u003ehttps://youtu.be/T29a0mnFka0\u003c/a\u003e\u003cbr\u003eTheir performances at ‚ÄùThe Tonight Show with Jimmy Fallon‚Äù (recorded in the ‚ÄùGyeongbok Palace‚Äù; the main royal palace of the Joseon dynasty built in 1395, Seoul), were absolutely stunning. For ‚ÄùIdol‚Äù they wore modern versions of national costumes Hanbok: \u003ca href=\"https://youtu.be/MXFkjMNXfpY\"\u003ehttps://youtu.be/MXFkjMNXfpY\u003c/a\u003e \u003cbr\u003e‚ÄùMikrokosmos‚Äù was recorded in the ‚ÄùGyeonghoeru Pavilion‚Äù located on a beautiful pond inside the palace. Fyi, the stars in the sky aren‚Äôt CGI but drones: \u003ca href=\"https://youtu.be/oYpUZjxJOVg\"\u003ehttps://youtu.be/oYpUZjxJOVg\u003c/a\u003e\u003cbr\u003eAt the show they also had a majestically, ethereally ‚ÄùBlack Swan‚Äù performance: \u003ca href=\"https://youtu.be/g1-sFn-j5D0\"\u003ehttps://youtu.be/g1-sFn-j5D0\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eDue to the cancellation of their world tour, they held an amazing online concert ‚ÄùMap of the soul On:e‚Äù. \u003cbr\u003eThey also released the wonderful 8-episode reality series, ‚ÄùBTS In The Soop‚Äù on the Weverse-app. The word ‚Äùsoop‚Äù means forest in Korean and the show followed BTS as they spent time doing fun things together outdoors.\u003cbr\u003eIn Nov. 2020, BTS released a new album ‚ÄùBE‚Äù; their 5th no.1 album on ‚ÄùBillboard 200‚Äù. The MV for title track ‚ÄùLife Goes On‚Äù was directed by Jungkook.\u003cbr\u003e For the AMA 2020 in which they won two awards (‚ÄùFavorite Duo or Group - Pop/Rock‚Äù and ‚ÄùFavorite Social Artist‚Äù), they pre-recorded their performance at the ‚ÄùSeoul Olympic Stadium‚Äù; a place that reminds them of Army.\u003cbr\u003eTheir wonderful Christmas themed performance of ‚ÄùDynamite‚Äù and ‚ÄùLife goes on‚Äù at ‚ÄùThe Late Late Show With James Gordon‚Äù exceeds everyone else‚Äôs we‚Äôve seen: \u003ca href=\"https://youtu.be/aMIGbLUJug4\"\u003ehttps://youtu.be/aMIGbLUJug4\u003c/a\u003e\u003cbr\u003eBTS Japanese 2021 single ‚ÄùFilm Out‚Äù had the most streams in 24h for a Japanese song.\u003cbr\u003eTheir Coldplay cover of ‚ÄùFix You‚Äù is incredibly beautiful and Coldplay even tweeted ‚ÄùBeautiful‚Äù in Korean, as well as on Youtube. \u003cbr\u003e\u003cbr\u003eBTS was the best-selling artist 2020. \u003cbr\u003eIn 2021, they got their own McDonalds BTS Meal. \u003cbr\u003e\u003cbr\u003eNo other boyband in the past, or any artist today can match the brilliance of BTS. They‚Äôre the biggest, a national treasure; biggest in modern time (far bigger than any Olympic athlete, classical musician etc). BTS will go down in history. There won‚Äôt be a group like BTS in the future.\u003cbr\u003e\u003cbr\u003eBtw, I‚Äôm not an English speaker and it isn‚Äôt my first language. Thanks for reading my tribute ‚Äùnovel‚Äù.\u003cbr\u003e\u003cbr\u003eSome of BTS‚Äôs amazing MV‚Äôs with incredible choreo:\u003cbr\u003e\u003cbr\u003e2015 Dope: \u003ca href=\"https://youtu.be/H8lYMWZD5P8\"\u003ehttps://youtu.be/H8lYMWZD5P8\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2015 Fire: \u003ca href=\"https://youtu.be/4ujQOR2DMFM\"\u003ehttps://youtu.be/4ujQOR2DMFM\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2016 Blood Sweat and Tears: \u003ca href=\"https://youtu.be/hmE9f-TEutc\"\u003ehttps://youtu.be/hmE9f-TEutc\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2017 Not Today: \u003ca href=\"https://youtu.be/9DwzBICPhdM\"\u003ehttps://youtu.be/9DwzBICPhdM\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2018 Airplane Pt.2 (Follow-up of J-Hope‚Äôs solo song ‚ÄùAirplane‚Äù)(This is the Japanese version) \u003ca href=\"https://youtu.be/CxnJf0tWu48\"\u003ehttps://youtu.be/CxnJf0tWu48\u003c/a\u003e",
              "textOriginal": "Last Part 7 of 7\n\nBTS is a true phenomenon of our generation. It‚Äôs really a story from ‚Äùnobodies‚Äù to legends. Each of the things they‚Äôve achieved and accomplished are well deserved and hard earned. They deserve their support, without those bitter, jealous, ignorant haters who‚Äôre downgrading their music, quality, talent, artistery and versatility. Haters will hate no matter what. The bigger success the more haters come alongbut most importantly more Armys.\n\nLynda Olanoff, creative consultant for horror films in Hollywood like Nightmare Before Christmas, working for Disney/Pixar, Warner bros etc. She tweeted: ‚ÄùThey are all very kind and humble, every last one of them. Had a chance to meet them at the Rose Bowl (LA) show back in May (2019). The love they have for eachother is amazing. I‚Äôve seen groups come and go for over 40 years now and let me tell you, BTS is here to stay.‚Äù \n\nTv-show host Jimmy Fallon said 2020: ‚ÄùIn my opinion there‚Äôs no other bigger band, in the United states and in the world. There‚Äôs no other bigger band than BTS. They can dance, they can sing, they can rap! They always put the time and the effort in. There‚Äôs no one like them. \nEverytime they came on, they would say something else to me, they‚Äôd say, we want to do this next, and they would do it! We wanna get nominated for a Grammy, and they did! It‚Äôs amazing. They‚Äôre magic. BTS is magic.‚Äù\n\nDue to the pandemic, BTS had to cancel their 2020 ‚ÄùMap Of the Soul‚Äù World Tour. In their annual ‚ÄùBTS Festa‚Äù party for their 7th anniversary, they heartfeltly teared up as they (at 47:50) talked about this: https://youtu.be/t9zPnWQIiuw\n\nHowever they‚Äôve kept working non-stop. They‚Äôve released two albums, had tons of wonderful performances with remarkable production works and scenographies, done VLives, interviews etc.\nThey performed a free live-streamed concert ‚ÄúBang Bang Con The Live Concert‚Äù. On Weverse they released their