 reality series, ‚ÄùBTS In The Soop‚Äù on the Weverse-app. The word ‚Äùsoop‚Äù means forest in Korean and the show followed BTS as they spent time doing fun things together outdoors.\nIn Nov. 2020, BTS released a new album ‚ÄùBE‚Äù; their 5th no.1 album on ‚ÄùBillboard 200‚Äù. The MV for title track ‚ÄùLife Goes On‚Äù was directed by Jungkook.\n For the AMA 2020 in which they won two awards (‚ÄùFavorite Duo or Group - Pop/Rock‚Äù and ‚ÄùFavorite Social Artist‚Äù), they pre-recorded their performance at the ‚ÄùSeoul Olympic Stadium‚Äù; a place that reminds them of Army.\nTheir wonderful Christmas themed performance of ‚ÄùDynamite‚Äù and ‚ÄùLife goes on‚Äù at ‚ÄùThe Late Late Show With James Gordon‚Äù exceeds everyone else‚Äôs we‚Äôve seen: https://youtu.be/aMIGbLUJug4\nBTS Japanese 2021 single ‚ÄùFilm Out‚Äù had the most streams in 24h for a Japanese song.\nTheir Coldplay cover of ‚ÄùFix You‚Äù is incredibly beautiful and Coldplay even tweeted ‚ÄùBeautiful‚Äù in Korean, as well as on Youtube. \n\nBTS was the best-selling artist 2020. \nIn 2021, they got their own McDonalds BTS Meal. \n\nNo other boyband in the past, or any artist today can match the brilliance of BTS. They‚Äôre the biggest, a national treasure; biggest in modern time (far bigger than any Olympic athlete, classical musician etc). BTS will go down in history. There won‚Äôt be a group like BTS in the future.\n\nBtw, I‚Äôm not an English speaker and it isn‚Äôt my first language. Thanks for reading my tribute ‚Äùnovel‚Äù.\n\nSome of BTS‚Äôs amazing MV‚Äôs with incredible choreo:\n\n2015 Dope: https://youtu.be/H8lYMWZD5P8\n\n2015 Fire: https://youtu.be/4ujQOR2DMFM\n\n2016 Blood Sweat and Tears: https://youtu.be/hmE9f-TEutc\n\n2017 Not Today: https://youtu.be/9DwzBICPhdM\n\n2018 Airplane Pt.2 (Follow-up of J-Hope‚Äôs solo song ‚ÄùAirplane‚Äù)(This is the Japanese version) https://youtu.be/CxnJf0tWu48",
