              "textDisplay": "Part 4 of 7:\u003cbr\u003e\u003cbr\u003eFor Suga‚Äôs 2016 mixtape, he adopted the alias Agust D. Agus = Suga backwards, and ‚Äùt D‚Äù is derived from his birthplace town Daegu. Before BTS, he was part of an underground rap group named D-Town. This is his awesome ‚ÄùDaechwita‚Äù MV: \u003ca href=\"https://youtu.be/qGjAWJ2zWWI\"\u003ehttps://youtu.be/qGjAWJ2zWWI\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eNothing of the above was ever the case with those past big Western boybands before BTS. They always got their same, similiar trivial pop-songs written for them, and all these had the same(!) songwriters, producers, label. Their music are still being played by Western radio, whereas BTS has been non-existent. In comparison to BTS they lacked dancing skills or couldn‚Äôt dance at all, without having better vocals. \u003cbr\u003eUsually a group/artist is good at one thingbut BTS isn‚Äôt only the best idol dancers in the music industry, they‚Äôre just as incredible rappers and singers. Moreover they‚Äôre producers, composers, songwriters. Their charisma and stage presence are outstanding, which is very obvious when watching other groups/artists perform. Their duality off-stage from normal guys to these confident, captivating performers on-stage is fascinating.\u003cbr\u003e\u003cbr\u003eJin is born in Gwacheon and has an older brother. He has a major in acting and wanted to become an actor. He was street-scouted on a bus as a teenager because of his good looks, and had no experience in singing or dancing. He was trained from scratch and through hard work became a wonderful vocalist and dancer. In the beginning some said he and RM were the least good dancers of BTS. But we must be fair and remember that some of the other members are the best dancers in the industry, and BTS has always been known for their tough choreo. That says alot about how amazing Jin and RM really are. They‚Äôd be outstanding in many other groups. At debute Jin got to be the visual of BTS, and Army nicknamed him ‚ÄùWorld-wide-handsome‚Äù. He makes his famous hand-blow-kisses and is known for his daddy-jokes. He is great at and enjoys computer games, snowboarding, fishing and goes mostly with Suga since both have few friends they hang out with. Jin is quite shy and has mentioned he‚Äôs got no friends, besides his 7 dongsaengs = younger brothers of BTS who‚Äôre his family. Jin said: ‚ÄùWe‚Äôre together like 360 out of 365 days‚Äù. \u003cbr\u003eJust as J-Hope he is known for being a ‚Äùscaredy-cat‚Äù, gets scared easily. The members have been together almost 24/7 for 10 years and are like an ‚Äùold married couple‚Äù.\u003cbr\u003e\u003cbr\u003eV is born in Daegu and has a younger sister and younger brother. He lived with his grandmother for many years who passed away which he cryingly revealed on stage some years ago. He was 15 when he joined BigHit and also got to be the visual. He got known for his dorky side and goofy sense of humour. Fans has also said that he looked like a pretty anime characther. He is great in basketboll and learns new choreo quickly. He has a dog named Yeontan ‚ÄùTannie‚Äù who is well-known among Army and has appeared in tweets and BTS Bombs. In 2016 V starred in the Korean TV-drama ‚ÄùHwarang: The Poet Warrior Youth‚Äù. \u003cbr\u003e\u003cbr\u003eJ-Hope is born in Gwangju has an older sister Jiwoo. He is called ‚Äùthe sunshine‚Äù of the group because of his sparky, energetic and enthusiastic nature, and has close to his loud, cheerful laughter. He can both rap and sing, and although RM and Suga are awesome in both ‚Äùclassic‚Äù and ‚Äùmelodic‚Äù rap, and can sing too, J-Hope is the best singer of the rapline. He was a dancer before BTS and is one of the group‚Äôs best dancers. He is their dance leader and in main charge of the choreography for BTS. They also got choreographer Son Sungdeuk who‚Äôve been with them for a long time. J-Hope has a dog Mickey. \u003cbr\u003e \u003cbr\u003eJimin is born in Busan (just as JK) and has a younger brother Jihyun. The members have said that Jimin has a special aura about him, and is the cutest, most charming in the team: \u003ca href=\"https://youtu.be/QHtRqopj3JI\"\u003ehttps://youtu.be/QHtRqopj3JI\u003c/a\u003e  He has a friendly, likable personality and is very funny: \u003ca href=\"https://youtu.be/7nvkf6lRtZg\"\u003ehttps://youtu.be/7nvkf6lRtZg\u003c/a\u003e \u003cbr\u003eHe is known for his androgynous attractive looks, and for being ‚Äùlovely, sexy and cute‚Äù. There‚Äôs a saying: ‚ÄùOnce u JimIN, u can‚Äôt JimOUT‚Äù. Some nicknames are ‚ÄùChimchim‚Äù, ‚ÄùMinnie‚Äù, ‚ÄùMochi‚Äù, ‚ÄùMangetteok‚Äù(sticky ricecake), the last two he got in the beginning because he had his cute, milky, round, babyfat cheeks/face.\u003cbr\u003eIn school Jimin was excellent in both sports and academics, and was the ‚ÄùClass President‚Äù. Above all, Jimin was legendary, an absolute top student at ‚ÄùBusan Highschool of Arts‚Äù and was majoring in the modern/contemporary Dance department. He was (and still is) exceptional and entered at the top of his class, including all students of both genders and in all majors (Dance, Music, Arts). Normally students majoring in Music or Arts enter at the top, so it‚Äôs very rare for a Dance-majoring student to enter at the top. Jimin could‚Äôve had a successful International career. At one of his teacher‚Äôs wedding, he got to do a solo dance performance. During middle school he attended a Dance Academy and learned popping and locking dance, and was winning street-dance battles in Busan. A young pre-debute Jimin: \u003ca href=\"https://youtu.be/wPywFydPOS0\"\u003ehttps://youtu.be/wPywFydPOS0\u003c/a\u003e  \u003cbr\u003eHis WIDE RANGE and brilliance in different genres (not only one), from hiphop to contemporary and classical ballet etc is astounding. He is one of the best dancers in the world, and definitely the best artist/idol dancer we‚Äôve ever seen. Jimin is known for his perfect lines, impressive flexibility, prominent moves and extraordinary fluidity and smoothness. He is also known for his fascinating duality on and off stage.\u003cbr\u003e\u003cbr\u003eJimin has also studied different kinds of martial arts like Kendo, and had a black belt in Taekwondo. K-media wrote; ‚ÄùBasketball, jump rope.. What can‚Äôt he do? Besides being an entertainment god with a natural sense of entertainment, he‚Äôs also outstanding athleticism‚Äù.\u003cbr\u003e\u003cbr\u003eJimin 21, is opening ‚ÄùSBS Gayo Daejun 2016‚Äù with other pro-dancers and K-artists:\u003cbr\u003e\u003ca href=\"https://youtu.be/bXN_TZyycYk\"\u003ehttps://youtu.be/bXN_TZyycYk\u003c/a\u003e\u003cbr\u003e\u003ca href=\"https://youtu.be/vdOQsDO1gjA\"\u003ehttps://youtu.be/vdOQsDO1gjA\u003c/a\u003e\u003cbr\u003eAs a dancer myself, I don‚Äôt think general people understand the strength and control Jimin has, and sadly never will. His flawless lines, his posture, how he keeps his toes pointed in his jumps, the airtime and still manage to lands lightly which takes years of hard training to ever attain. He is on a whole other level than any idol I‚Äôve ever seen, even compared to these other dancers. He is very well-known among Korean modern dancers, who all agree he has raised the bar for idol dancers.\u003cbr\u003e\u003cbr\u003eJimin‚Äôs 24, breathtaking solo dance performance to a piano version of BTS‚Äôs song ‚ÄùI need u‚Äù, at ‚ÄùMMA‚Äù 2019: \u003ca href=\"https://youtu.be/8D7Wnnow2kQ\"\u003ehttps://youtu.be/8D7Wnnow2kQ\u003c/a\u003e \u003cbr\u003e \u003cbr\u003eJ-Hope 24, Jimin 23, and Jungkook 21 (called the 3J‚Äôs and the best dancers), amazing performances to traditional Korean tunes and instruments, dressed in Korean attires at ‚ÄùMMA‚Äù 2018: \u003ca href=\"https://youtu.be/XozYg4IuDgY\"\u003ehttps://youtu.be/XozYg4IuDgY\u003c/a\u003e\u003cbr\u003eAfterwards Jimin recieved plaque of appreciation from the ‚ÄùCultural Conservation Society‚Äù. \u003cbr\u003e\u003cbr\u003eAt ‚ÄùMAMA‚Äù 2016, Jimin 21 (impressively dancing blindfolded which is extremely difficult) and J-hope 22, performing perfectly in-sync: \u003ca href=\"https://youtu.be/PYRiohUv-9Y\"\u003ehttps://youtu.be/PYRiohUv-9Y\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eJimin 24, Behind-the-scenes of his contemporary solo parts in Black Swan MV (\u003ca href=\"https://www.youtube.com/watch?v=3kRl7gkXdXM&amp;t=2m40s\"\u003e2:40\u003c/a\u003e) : \u003ca href=\"https://youtu.be/xMfp2jcK52M\"\u003ehttps://youtu.be/xMfp2jcK52M\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eAt BTS‚Äôs online concert ‚ÄùMap of the Soul ON:E‚Äù 2020, Jimin performed two solos. His incredible ‚ÄùBlack Swan‚Äù contemporary dance solo: \u003cbr\u003ePt.2 \u003ca href=\"https://youtu.be/RM_OYxn0cTg\"\u003ehttps://youtu.be/RM_OYxn0cTg\u003c/a\u003e\u003cbr\u003ePt.3 \u003ca href=\"https://youtu.be/FL8sD9UHdZs\"\u003ehttps://youtu.be/FL8sD9UHdZs\u003c/a\u003e\u003cbr\u003ePt.4 \u003ca href=\"https://youtu.be/alm9jzWlmkI\"\u003ehttps://youtu.be/alm9jzWlmkI\u003c/a\u003e\u003cbr\u003eHis stunning performance of ‚ÄùFilter‚Äù: \u003ca href=\"https://youtu.be/FcVYa077Rgg\"\u003ehttps://youtu.be/FcVYa077Rgg\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eNo band today, and no past Western boyband were ever close to any of this, nor be able to pull off World Stadium tours. Smaller concerts yesbut not close to arenas with 70000+ audience. Stadiums like MetLife, Rose Bowl, Soldier Field, Wembley, Stade de France etc. All members are individually very talented. They equally sing or rap with distinct voices which are easy to recognize, and together blend and harmonize perfectly. Unlike past Western boybands were litterally 2 or 3 out of 5 could sing. The rest were anonymous, had no solo parts and barely ever heard. BTS has set the bar high for future boybands. They‚Äôre pioneers, innovaters and was the first K-act and Asian-act to really make it in America and globally. Their hard work has undoubtly paved the way for other K-artists.\u003cbr\u003e\u003cbr\u003eThe premiere performance of ‚ÄùBlack Swan‚Äù from 2020 album ‚ÄùMap Of The Soul: 7‚Äù at the ‚ÄùLate late show with James Gordon‚Äù, proved once again they aren‚Äôt the prejudice of ‚Äùjust a boyband‚Äù. They‚Äôre artistic performers with remarkable diversity, versatility, artistery, dance skills, vocals, rap: \u003ca href=\"https://youtu.be/wSNd02kVv8o\"\u003ehttps://youtu.be/wSNd02kVv8o\u003c/a\u003e\u003cbr\u003eTheir instrumental violin ‚ÄùBlack Swan‚Äù performance at MMA 2020 was mind-blowing art: \u003ca href=\"https://youtu.be/0bgL7juKY6Q\"\u003ehttps://youtu.be/0bgL7juKY6Q\u003c/a\u003e\u003cbr\u003eFrom the same album there‚Äôs title track ‚ÄùON‚Äù with downright insane choreo, with a spectacular MV: \u003ca href=\"https://youtu.be/gwMa6gpoE9I\"\u003ehttps://youtu.be/gwMa6gpoE9I\u003c/a\u003e. The ‚ÄùON‚Äù MV no.2 is like a grand, epic movie: \u003ca href=\"https://youtu.be/mPVDGOVjRQ0\"\u003ehttps://youtu.be/mPVDGOVjRQ0\u003c/a\u003e\u003cbr\u003eOne of their amazing live ‚ÄùON‚Äù performances: \u003ca href=\"https://youtu.be/4LE5dSA6RFg\"\u003ehttps://youtu.be/4LE5dSA6RFg\u003c/a\u003e\u003cbr\u003eThey also performed ‚ÄùON‚Äù at the Grand Central Terminal, NYC, at the ‚ÄùTonight show with Jimmy Fallon‚Äù.\u003cbr\u003e\u003cbr\u003eAntis who‚Äôre used to Western artists who don‚Äôt do hard dance choreo, have accused BTS for lip-syncing. Pre-debute they practiced 24/7 to become skilled at both at the same time, and still do for comebacks and performances. Take a look at BTS‚Äôs ‚ÄùMAMA nominees performance‚Äù 2019 of powerful ‚ÄùDionysius‚Äù, which shows their live skills of both dancing and singing/rap: \u003ca href=\"https://youtu.be/BxcUVsa2gb0\"\u003ehttps://youtu.be/BxcUVsa2gb0\u003c/a\u003e\u003cbr\u003eIn the Western music scene it‚Äôs very common to use backtracks, even artists without any choreo at all. BTS rarely complements their live vocals with a backtrack, only sometimes in very tough choreo parts. The insane choreo in ‚ÄùON‚Äù dance practice video: \u003ca href=\"https://youtu.be/VkuEzN8IS_o\"\u003ehttps://youtu.be/VkuEzN8IS_o\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eContinue part 5 of 7 in the replies",
