              "textDisplay": "Part 3 of 7: \u003cbr\u003e\u003cbr\u003eIn Sep 2018 they were the first Western and Korean boyband to be invited to the U.N. United Nations, for the launch ceremony of UNICEF&#39;s global partnership Generation Unlimited. BTS delivered a speech in which they urged young people to believe in their own convictions and voices, to not only Love Yourself but also to Speak Yourself. RM ended his speech with the words: ‚ÄùNo matter who you are, no matter where you‚Äôre from, your skin color, your gender identity..speak yourself, find your name and find your voice, by speaking yourself‚Äù. \u003cbr\u003e\u003cbr\u003eFor the Korean music award season at the end of every year, BTS practices so hard for their performances. Award shows such as: Golden Disk Awards (GDA), Gaon Chart Music Awards, Seoul Music Awards (SMA), Korean Music Awards (KMA), Fact Music Awards, Asia Artist Awards (AAA), Mnet Asian Music Awards (MAMA), Melon Music Awards (MMA), Plus x Genie Music Awards (MGA), SBS Gayo Daejeon, KBS Gayo Daechukje. BTS has won the most ‚ÄùDaesangs‚Äù (biggest prestigious main music awards) in S.Korean history as of now with over 40 daesangs. They‚Äôre also the overall most decorated K-artist in history. \u003cbr\u003eAt ‚ÄùMAMA‚Äù 2019, BTS performed their first singles ‚ÄùWe Are Bulletproof Pt.2‚Äù and ‚ÄùN.O‚Äù from 2013 debute album: \u003ca href=\"https://youtu.be/gdrO-iU3Glg\"\u003ehttps://youtu.be/gdrO-iU3Glg\u003c/a\u003e\u003cbr\u003eA must-watch is the dance practice for their 2020 MAMA performance of ‚ÄùON‚Äù: \u003ca href=\"https://youtu.be/81sNq45I48s\"\u003ehttps://youtu.be/81sNq45I48s\u003c/a\u003e  Suga wasn‚Äôt able to perform that season due to a shoulder surgery.\u003cbr\u003e\u003cbr\u003eBTS was ignored at the Grammys 2020, despite the fact that they (with ‚ÄùMap of the Soul: Persona‚Äù) had the 3rd bestselling album worldwide 2019, and litterally out-sold all the other artists that were nominated for ‚ÄùAlbum of the year‚Äù. Some said BTS isn‚Äôt American and doesn‚Äôt sing in Englishbut it shouldn‚Äôt matter at all if looking back through the years with all non-Americans. Besides, it doesn‚Äôt need to be in English either. Puerto Rican Luis Fonci‚Äôs (born 1978) all Spanish ‚ÄùDespacito‚Äù was totally embraced by the Grammys. \u003cbr\u003eFor the Grammys 2021, BTS finally got a nomination in the category ‚ÄùBest Pop Duo/Group Performance‚Äù. Although they boys are ecstatic and honoured, alot of people agree they deserved nominations in other categories too. They had the bestselling album 2020, not only in S.Korea, Japan and USA but also Worldwide with masterpiece ‚ÄùMap of The Soul: 7‚Äù, and really deserved a nomination in the ‚ÄùAlbum of the year‚Äù category. Korean BTS has quality and artistery on all levels, which is something that alot of people in the American/European/Western music industry refuse to accept or admit. \u003cbr\u003eTheir spectacular ‚ÄùDynamite‚Äù performance: \u003ca href=\"https://youtu.be/IU9KRreWIH8\"\u003ehttps://youtu.be/IU9KRreWIH8\u003c/a\u003e\u003cbr\u003eHowever, BTS is the first Korean-act in history to get a nomination, and also the first Korean act to perform at the Grammys in 2020, even though BTS was only ‚Äùback-up‚Äù for Lil Nas X.\u003cbr\u003e\u003cbr\u003e‚ÄúPlease don‚Äôt forget that whether we get the Grammy or not, we already got what we wanted and we got YOU, so that means we got everything.‚Äù \u003cbr\u003e- Kim Namjoon (RM)\u003cbr\u003e\u003cbr\u003eIn their early years, BTS went through alot of sacrifices, hardships and struggles, both as a group and individually. Their tears and break-downs on stage (of gratitude, love, relief after hard work etc) during their speeches at award-shows and at concerts are heartbreaking. They‚Äôve always loved, cared for, encouraged and inspired Army, and many have expressed how BTS and their music have lighten up and changed their lives. Army who‚Äôve had a hard time have gained positivity, strength, confidence, well-being, inspiration and belief for the future etc.\u003cbr\u003e\u003cbr\u003eIt‚Äôs unfair and sad that alot of Western showbiz and media plainly ignore and reduce BTS, and that many radio channels won‚Äôt play their music. Those people don‚Äôt know anything about BTS and aren‚Äôt interested in finding out either. But still they‚Äôre discriminating, downgrading, not taking them seriously and don‚Äôt give them recognition only because they‚Äôre a Korean/East Asian group. They should step back with their narrow minds and predjudice. How can their race matter that much?\u003cbr\u003eRM said: ‚ÄùWe‚Äôre just normal guys who love to make music and to perform, and want to share it with our fans‚Äù. \u003cbr\u003eBesides, BTS isn‚Äôt just ‚Äùany‚Äù Kpop group. They‚Äôre totally outstanding and has an unique charm we haven‚Äôt seen before. Their music and achievements are groundbreaking, not only in Kpop but in the global scene. Their consistency, passion, dedication, hard work, artistery and talent are undeniable. What makes other Western artists‚Äô generic mainstream music more real and genuine whose music are being played over and over?! Besides, Western media is unreasonably never ranking BTS in the top of ‚Äùthe biggest boybands in history-lists‚Äù. \u003cbr\u003e\u003cbr\u003eKpop has a huge domestic market and has for a long time been considered a generic name for all Korean music genres, not only pop. No one needs to hit globally to become stars. BTS has never needed to collab. with a Western artist or make an English album to become superstars, or get where they are today. They‚Äôve made it on their own singing in Korean. They‚Äôve collab. simply because they‚Äôve liked the artist. The truth is, other artists would gain more of a collab. with BTS than the other way around because of BTS‚Äôs huge fanbase. Yet in interviews they‚Äôre repeatedly asked which Western artist they want to collab. with, as if it‚Äôd be the highest wish of their career. They‚Äôre also pressured when always asked about their next goal, instead of letting them breath after hard work and enjoy the moment. \u003cbr\u003e\u003cbr\u003eBTS is mainly producing, composing and writing their own songs and lyrics, sometimes co-writing too. They‚Äôre dedicated and sincere with alot of thoughts and reflections behind their music. It‚Äôs not just empty words written by others who don‚Äôt know them. The members‚Äô solo songs are written by the member himself or together with a member. They‚Äôve also released non-profitable solo songs (and not on an official album), like Jimin‚Äôs ‚ÄùPromise‚Äù and V‚Äôs ‚ÄùWinter Bear‚Äù on SoundCloud. JK has multiple times released incredible English and Korean ballad covers. Some releases have also been surprises for Army at the ‚ÄùBTS Festa‚Äù through the years. JK and Jimin made a beautiful cover of ‚ÄùWe Don‚Äôt Talk Anymore‚Äù for the 2017 ‚ÄùBTS Festa‚Äù.\u003cbr\u003eBTS‚Äôs work is inspired by litterature, art and philosophy. Their lyricism is well-written, poetical and really on another level. All their MV‚Äôs have English subs that International Army are suppose to turn on, although the English translations can‚Äôt do fully justice.\u003cbr\u003e\u003cbr\u003eBTS has a solid discography in both Korean and Japanese with roots in hiphop and R&amp;B. In their early years all 7 studied Japanese and all members can speak Japanese, especially JK and the maknae line as they were younger when they started. When they perform in Japan they sing many of their songs in Japanese. There‚Äôre also songs made only in Japanese, like awesome ‚ÄùDon‚Äôt Leave Me‚Äù: \u003ca href=\"https://youtu.be/Cz6BUM4F2tY\"\u003ehttps://youtu.be/Cz6BUM4F2tY\u003c/a\u003e and ‚ÄùStay Gold‚Äù: \u003ca href=\"https://youtu.be/9C1BNeLmhLk\"\u003ehttps://youtu.be/9C1BNeLmhLk\u003c/a\u003e  All BTS‚Äôs albums are highly complex concept albums, always with a well thought-out theme and storyline. The songs and MV‚Äôs for the songs on the same album, have intertwined connections, messages and symbolism. They also connect with their previous work, and if u put all the albums together in order they tell a ‚Äùstory‚Äù. Usually Army discover the connections little by little, sometimes making theories too.\u003cbr\u003e\u003cbr\u003eRM 26 is born in Ilsan and has a younger sister. He was in the underground scene for a long time before BTS, and has over 150 songs under his name, all masterpieces. He is a prodigy but underrated. He has an IQ of over 148 and scored among the highest within the top 1% of the nation in the massive University Entrance Exams. He also scored over 900 on the ‚ÄùTest of English for International Communication‚Äù while he was still in Middle school. He is awesome in English which he learned as a youngster by watching TV-show ‚ÄùFriends‚Äù. He‚Äôs known for his ‚Äùcultural‚Äù side and is collecting arts, enjoys museums, parks, sightseeing, bicycling. He‚Äôs also known for being clumsy, accidentally spilling, breaking or hitting things as well as losing his stuff (passport, earpods, mobile), and is by the members called ‚ÄùGod of destruction‚Äù. He‚Äôs been quite bad at cooking, although he and the others have improved through the years. Suga and Jin are the best chefs.\u003cbr\u003e\u003cbr\u003eSuga is born in Daegu and has an older brother. He got early known as the ‚Äùsavage‚Äù of the group. He is deep, wise, honest, doesn‚Äôt open-up or show feelings easily and isn‚Äôt as touchy-feely. He usually dosen‚Äôt show as much facial expressions or make eye contact, which are something that the other members have had alot of fun about. He‚Äôs is known for his gummy smile. The members and Army sometimes make jokes about him for being tired, wanting to rest or sleep, not moving if not necessary. Jin once joked to the cam: ‚ÄùNow I‚Äôll go into Suga‚Äôs mind and he wishes to be born as a stone in his next life‚Äù. Suga can rap impressively fast and is the fastest of the 3 rappers. He is an incredible producer who‚Äôs also collaborated and produced songs for other Korean artists, and has won ‚ÄùBest Producer‚Äù awards. He and RM are the members who‚Äôre writing most of BTS‚Äôs songs. Moreover he has a dog named Holly. In the past Suga was a great basketboll player. He is also playing guitar and is an amazing piano player. Here he‚Äôs beautifully playing a part of his piano version of BTS‚Äôs ‚ÄùI need u‚Äù: \u003ca href=\"https://youtu.be/JyHaRCMbx6A\"\u003ehttps://youtu.be/JyHaRCMbx6A\u003c/a\u003e \u003cbr\u003eThis is a low-key performance of ‚ÄùI need u‚Äù at ‚ÄùPicnic Live MBC‚Äù on a rooftop 2015: \u003ca href=\"https://youtu.be/S8gT8KhkGBQ\"\u003ehttps://youtu.be/S8gT8KhkGBQ\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eContinue part 4 of 7 in the replies.",
